const app = getApp()
Page({

  /**
   * 页面的初始数据
   */
  data: {
    startBarHeight: 0,
    navgationHeight: 0
  },

  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function (options) {
    this.setData({
      startBarHeight: app.appData.startBarHeight,
      navgationHeight: app.appData.navgationHeight,
    })
  },

  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function () {
    var context = wx.createCanvasContext('myCanvas')
    context.moveTo(0, 30)
    context.setTextAlign('center')
    context.setFontSize(25)
    context.setFillStyle('#111111')
    context.fillText('我是孤独的冒险家', 165, 60)
    context.drawImage('./image/img.png', 20, 80, 295, 150)
    context.setTextAlign('left')
    context.setFontSize(13)
    context.setFillStyle('#333333')
    var txtArray = this.canvasWorkBreak(295, 13, '我是天生特爱冒险，骨子里流动着试探的血液，因此，柔美和自然风光或熙熙攘攘的城市风光都征服不了你城市风光都征服不了你城市风光都征服不了你城市风光都征服不了你城市风光都征服不了你')
    var positionY = 0
    for(var i = 0 ; i < txtArray.length; i++){
      positionY = 250 + i * 20
      context.fillText(txtArray[i], 20, positionY)
    }
    context.setStrokeStyle('#dddddd')
    context.beginPath()
    context.setLineWidth(0.1)
    context.moveTo(20, positionY + 20)
    context.lineTo(315, positionY + 20)
    context.stroke()

    context.setTextAlign('left')
    context.setFontSize(16)
    context.setFillStyle('#0f375d')
    context.fillText('测试你是具有哪种神秘气质的', 20, positionY + 47)
    context.fillText('旅行达人吧 >>>', 20, positionY + 68)
    var base64 = 'data:image/jpeg;base64,'
    context.drawImage(base64, 265, positionY + 30, 50, 50)
    context.draw()
  },
  canvasWorkBreak: function(maxWidth, fontSize, text) {
    const maxLength = maxWidth / fontSize
    const textLength = text.length
    let textRowArr = []
    let tmp = 0
    while(1) {
      textRowArr.push(text.substr(tmp, maxLength))
      tmp += maxLength
      if (tmp >= textLength) {
        return textRowArr
      }
    }
  },
  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function () {

  },

  /**
   * 生命周期函数--监听页面隐藏
   */
  onHide: function () {

  },

  /**
   * 生命周期函数--监听页面卸载
   */
  onUnload: function () {

  },

  /**
   * 页面相关事件处理函数--监听用户下拉动作
   */
  onPullDownRefresh: function () {

  },

  /**
   * 页面上拉触底事件的处理函数
   */
  onReachBottom: function () {

  },

  /**
   * 用户点击右上角分享
   */
  onShareAppMessage: function () {

  },
  bindEnter: function () {
    wx.navigateTo({
      url: './second',
    })
  },
  bindBack: function () {
    console.log('back')
    wx.navigateBack({
      delta: 1
    })
  }
})